  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:54.411898\",\n\t\"name\": \"agassiz-national-wildlife-refuge-annual-narrative-report-calendar-year-1991\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Agassiz
  National Wildlife Refuge outlines Refuge accomplishments during the 1991 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  management planning, compliance with environmental and cultural resource mandates
  and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, other manpower programs, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, croplands, grasslands, haying, fire management, pest control,
  and wilderness and special areas. The wildlife section of the report discusses wildlife
  diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
  shorebirds, raptors, other migratory birds, mammals, other resident wildlife, fisheries
  resources, scientific collections, animal control, and marking and banding. The
  public uses of the Refuge described in this report include outdoor classrooms, interpretive
  programs, hunting, trapping, and law enforcement. The equipment and facilities section
  of the report provides information about new construction, rehabilitation, major
  maintenance, equipment utilization and replacement, communication systems, computer
  systems, and energy conservation. Cooperative programs are provided at the end.
  Photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
